import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import axios from 'axios';

const root = ReactDOM.createRoot(document.getElementById('root'));

axios
  .get('http://localhost:3001/notes')
  .then(response => {
    const notes = response.data
    root.render(
  <React.StrictMode>
    <App notes={notes} />
  </React.StrictMode>
)
});
